import {Component} from "react";
import CompDisplay from "./ProgLangDisplay";
import './css/style.css';
import ReactIcon from './css/img/react.png';
import ProgLangDisplay from "./ProgLangDisplay";

class ProgLang extends Component{

    render(){
        return(
            <div className={"progLang"}>
                <h2 className={"title"}>Langages de programmation</h2>
                <div className={"progLangDisplay"}>
                    <ProgLangDisplay name={"React"} img={ReactIcon}/>
                    <ProgLangDisplay name={"Java"} img={ReactIcon}/>
                    <ProgLangDisplay name={"PHP"} img={ReactIcon}/>
                    <ProgLangDisplay name={"C#"} img={ReactIcon}/>
                    <ProgLangDisplay name={"Git"} img={ReactIcon}/>
                    <ProgLangDisplay name={"Bash"} img={ReactIcon}/>
                    <ProgLangDisplay name={"C"} img={ReactIcon}/>
                    <ProgLangDisplay name={"Unity"} img={ReactIcon}/>
                    <ProgLangDisplay name={"Oracle"} img={ReactIcon}/>
                    <ProgLangDisplay name={"Javascript"} img={ReactIcon}/>
                    <ProgLangDisplay name={"HTML"} img={ReactIcon}/>
                    <ProgLangDisplay name={"CSS"} img={ReactIcon}/>
                </div>
            </div>

        );
    }
}

export default ProgLang;
